import React from 'react';
import {Link} from 'react-router-dom';
import Button from 'react-bootstrap/Button';
function shoot() {
    console.log("button pressed");
    alert("Great Shot!");
  }
function Home() {
    return (
      
        <div>
             <Link exact to='/about' style={{ textDecoration: 'none' }} ><h2 className="about"> About</h2></Link>
            <div className="interface">
               
             <h1>Sentiment Analysis <br/>through rating</h1><br/>
             <div className="form">
                 <input type="text" id="input-form"  name="comments" autoComplete="Off" required/>
                 <label htmlFor="comments" className="label-comments">
                     <span className="content-comments">Enter some comments</span>
                     </label>
             </div>
             
             {/* start of button code */}
             <Button>
             <svg viewBox="45 60 400 320" xmlns="http://www.w3.org/2000/svg">
    <path fill="#fff" d="M 90 210 C 90 180 90 150 90 150 C 150 150 180 150 180 150 C 180 150 300 150 300 150 C 300 150 330 150 390 150 C 390 150 390 180 390 210 C 390 240 390 270 390 270 C 330 270 300 270 300 270 C 300 270 180 270 180 270 C 180 270 150 270 90 270 C 90 270 90 240 90 210" mask="url(#knockout-text)" >
    </path>
    <mask id="knockout-text">
      <rect width="100%" height="100%" fill="#fff" x="30" y="40" />
      
      <text x="140" y="227" fill="#000">BUTTON</text>
    </mask>
</svg>
</Button>

{/* <button onClick={shoot}>Take the shot!</button> */}



             {/* End of button code */}
             </div>
        </div>
     
    )
}

export default Home
